import ReactDOM from 'react-dom';

export const ProductList = () => {
  return (
    ReactDOM.render(
        <React.StrictMode>
              <h1>This is the Product List Page</h1>
        </React.StrictMode>,
        document.getElementById('root')
      )
  )
}
